import './App.css';
import { BrowserRouter as Router, Routes, Link} from 'react-router-dom';


function App() {
  function Home(){
    return <h2> Home </h2>;
  }

  function About(){
    return <h2> About </h2>;
  }

  function Contact(){
    return <h2> Contact </h2>;
  }
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li><a href = "/"> Home </a></li>
            <li><a href = "/about"> About </a></li>
            <li><a href = "/contact">Contact</a></li>
          </ul>
        </nav>
       <Route path = "/" Component={Home} />
       <Route path = "/about" Component={About}/>
       <Route path = "/contact" Component={Contact}/>
       <h1> Hi My name is Nyi Htet</h1>
       <p class = "first-paragraph">
        I am an aspiring software engineering who wants to pursue a career in tech
       </p>
    </div>

    </Router>

  );
}

export default App;
